import React, { createContext, useContext, useState } from 'react';

// Create a context for property data
const PropertyContext = createContext();

// Custom hook to access property context
export const usePropertyContext = () => useContext(PropertyContext);

// Property context provider component
export const PropertyProvider = ({ children }) => {
  const [propertyData, setPropertyData] = useState({
    // Initialize with default property data if needed
    propertyValue: 0,
    carpetArea: 0,
    pincode: '',
    security24x7: 'No',
    buildingAge: '0',
    premium: 0,
    propertyEffect: 'No',
    isSalaried: 'Yes',
  });

  // Function to update property data
  const updatePropertyData = (newData) => {
    setPropertyData({ ...propertyData, ...newData });
  };

  return (
    <PropertyContext.Provider value={{ ...propertyData, updatePropertyData }}>
      {children}
    </PropertyContext.Provider>
  );
};
